- input: "TEXT\x1CC00030718\x1C1\x1C\x1CF3XN\x1CFor the 10/25/11 $100.00 contra disbursement
    reported on Line 21b of this report and transferred to Line 23, the full purpose
    of disbursement should be noted as: In-Kind Consulting Services, see Line 23 item.
    For the 10/28/11 $100.00 contra disbursement reported on Line 21b of this report
    and transferred to Line 23, the full purpose of disbursement should be noted as:
    In-Kind Consulting Services, see Line 23 These amounts relate to an original $8,000.00
    advance payment made to the National Association of Realtors for consulting services
    on 9/13/2010 and reported on Line 21b of the October 2010 monthly report. Subsequently
    in 2010, we utilized $6,200.00 of this advanced payment as consulting services
    attributable to independent expenditures & reflected as negative amounts subtracted
    from Line 21b and transferred to Line 24.  In April 2011, we utilized $100.00
    of this advance payment as consulting services attributable to In-Kind events
    & reflected as negative amounts subtracted from Line 21b and transferred to Line
    23.  In May 2011, we utilized $100.00 of this advance payment as consulting services
    attributable to In-Kind events & reflected as negative amounts subtracted from
    Line 21b and transferred to Line 23.  In June 2011, we utilized $100.00 of this
    advance payment as consulting services attributable to In-Kind events & reflected
    as negative amounts subtracted from Line 21b and transferred to Line 23.  In Sept
    2011, we utilized $200.00 of this advance payment as consulting services attributable
    to In-Kind events & reflected as negative amounts subtracted from Line 21b and
    transferred to Line 23. In October 2011, $100.00 of the original $8,000.00 is
    being utilized as consulting services attributable to In-Kind events & reflected
    on Line 23 of this period, with the full purpose of disbursement as: Transfer
    from Line 21b to Line 23 attributed as consulting services on 10/25/2011 for In-Kind
    event for Brad Sherman.  Also in October 2011, $100.00 of the original $8,000.00
    is being utilized as consulting services attributable to In-Kind events & reflected
    on Line 23 in this period, with the full purpose of disbursement as: Transfer
    from Line 21b to Line 23 attributed as consulting services on 10/28/11 for In-Kind
    event for Kay Hagan.   For Line 22 of this report, the following entries are refunds
    for contributions received by this committee that were unacceptable. The entries
    we reference contain the payee, date & amount of disbursement, along with the
    original date of receipt. The following contributions represented by the refund
    is reported as unitemized on the 11/20/11 monthly report: Georgia RPAC $10.80
    on 10/24/11 orig recd 10/18/11; Idaho RPAC $1,650.00 on 10/28/11 orig rec'd 10/25/11.
    The refunds for Pennsylvania RPAC $48.00 on 10/27/11 and Wyoming RPAC $7.50 on
    10/27/11 were refunds for transmissions of funds inadvertantly sent in error by
    the respective state agents.\n"
